import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./css/nav.css";
function Nav() {
  const[dw,setdw]=useState(false);
  const p=(event)=>{
    event.preventDefault();
    setdw(true);
  }
  return (
    <div className="nav">
      <div id="nn">GAMING HUB</div>
      <div id="hurl">
        <ul>
          <li id="nh">
            <Link to="/home" className="link">
              HOME
            </Link>
          </li>
          <li className="urp">
            <Link to="/um" className="link">
              UPCOMMING MATCHES
            </Link>
          </li>
          <li className="urp">
            <Link className="link">RESULT</Link>
          </li>
          <li className="urp">
            <Link className="link" id="pr" onFocus={p}>
              PROFILE
            </Link>
          </li>
        </ul>
      </div>
      {dw ? (
        <div className="dw">
          <button id="d">DEPOSIT</button>
          <button id="w">WITHDRAW</button>
        </div>
      ) : null}
    </div>
  );
}
export default Nav;
